import "./App.css";
import AForm from "./components/aForm";
import ASection from "./components/aSection";

function App() {
  return (
    <div className="App">
      <Container>
        <Box width="800px">
          <ASection>
            <AForm />
          </ASection>
        </Box>
      </Container>
    </div>
  );
}

export default App;
